#include <stdio.h>
#include <memory.h>

#define QSIZE 111111
#define SIZE 111

int N;
int region[SIZE][SIZE];
bool visited[SIZE][SIZE];
int q[QSIZE][2];
int front, rear;
int min_h = 100;  //지역중 가장 작은 높이
int max_h = 1;    //지역중 가장 큰 높이
int cnt;    //우천시 지역 개수
int max_cnt = 0;
int rain;   //비의 양

int dirR[4] = {0, 0, 1, -1};
int dirC[4] = {1, -1, 0, 0};

int rain_collapse(int r);

void bfs(int row, int col, int cnt, int r);

int main() {

	for(int i=0; i<SIZE; i++) {
		for(int j=0; j<SIZE; j++) {
			region[i][j] = 0;
			visited[i][j] = false;
		}
	}

	scanf("%d", &N);
	for(int i=1; i<=N; i++) {
		for(int j=1; j<=N; j++) {
			scanf("%d", &region[i][j]);
			if(min_h > region[i][j]) min_h = region[i][j];
			if(max_h < region[i][j]) max_h = region[i][j];
		}
	}

	//r이하의 지역은 잠긴다
	/*
		0 -> 비가 안올때 아무지역도 안잠기므로 1
		답은 항상 1과 같거나 크다!
	*/
	for(int r=0; r<max_h; r++) {
		cnt = rain_collapse(r);
		// printf("%d : %d\n", r, cnt);
		if(max_cnt < cnt) max_cnt = cnt;
	}

	printf("%d\n", max_cnt);

	return 0;
}

// 모든 영역을 탐색하여 해당하는 cnt를 반환
int rain_collapse(int r) {
	//초기화
	int c = 0;
	front = 1;
	rear = 1;
	for(int i=0; i<SIZE; i++) {
		for(int j=0; j<SIZE; j++) {
			visited[i][j] = false;
		}
	}

	for(int i=1; i<=N; i++) {
		for(int j=1; j<=N; j++) {
			if(region[i][j] > r && visited[i][j] == false) {
				bfs(i, j, ++c, r);
			}
		}
	}
	return c;
}

void bfs(int row, int col, int c, int r) {
	visited[row][col] = true;
	q[rear][0] = row;
	q[rear++][1] = col;
	rear %= QSIZE;

	while(!(front == rear)) {
		int frow = q[front][0];
		int fcol = q[front++][1];
		front %= QSIZE;

		for(int i=0; i<4; i++) {
			int nextR = frow + dirR[i];
			int nextC = fcol + dirC[i];

			if(visited[nextR][nextC] == false && region[nextR][nextC] > r) {
				visited[nextR][nextC] = true;
				q[rear][0] = nextR;
				q[rear++][1] = nextC;
				rear %= QSIZE;
			}
		}
	}
}

